import React from "react";

const Lines = () => {
  return (
    <div className="mt-4">
      <svg
        className="w-full"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 1440 320"
      >
        {[...Array(7)].map((_, index) => (
          <path
            key={index}
            stroke="#ffffff"
            strokeWidth="1"
            fill="none"
            d={`M0 ${256 - index * 30} C${100 + index * 30} ${
              250 - index * 20
            }, ${600 - index * 30} ${300 - index * 30}, 1440 ${
              266 - index * 30
            }`}
          ></path>
        ))}
      </svg>
    </div>
  );
};

export default Lines;
